DROP TABLE IF EXISTS BDD;
CREATE TABLE BDD (
id mediumint(8) unsigned NOT NULL auto_increment,
Nom VARCHAR(255) ,
Prenom VARCHAR(255) ,
Age NUMERIC(9) ,
Situationfamiliale NUMERIC(9) ,
Nombreenfantacharge NUMERIC(9) ,
Situationproffessionnelle NUMERIC(9) ,
Sisalarie NUMERIC(9) ,
Revenu NUMERIC(9) ,
Loyer NUMERIC(9) ,
CreditImmobilier NUMERIC(9) ,
Autrecredit NUMERIC(9) ,
Assurance NUMERIC(9) ,
SanteMutuelle NUMERIC(9) ,
Voiture NUMERIC(9) ,
Autretransports NUMERIC(9) ,
Communication NUMERIC(9) ,
Loisirssortie NUMERIC(9) ,
Alimentaire NUMERIC(9) ,
VieQuotidienne NUMERIC(9) ,
Comptecourant NUMERIC(9) ,
Livretjeune NUMERIC(9) ,
LivretA NUMERIC(9) ,
PEL NUMERIC(9) ,
Assurancevie NUMERIC(9) ,
Creditdeconsommation NUMERIC(9) ,
CreditImmobilier NUMERIC(9) ,
Creditauto NUMERIC(9) ,
Creditetudiant NUMERIC(9) ,
PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;



